/*import React from "react";
import { AppointmentTile } from "../tile/AppointmentTile";


export const AppointmentTileList = ({ appointments }) => {
  return (
    <div>
      {appointments.map((appointment, index) => {
        const { name, ...appointmentDetails } = appointment;
        return <AppointmentTile key={index} name={name} appointmentDetails={appointmentDetails} />;
      })}
    </div>
  );
};
*/
